import React from 'react';
import './AddImage.css';
import Navbar from '../Home/Navbar/Navbar';

const AddImage = () => {
    return (
        <section style={{ position: "relative" }} className="landing">
            <Navbar />
            <div
                style={{
                    position: "absolute",
                    top: "50%",
                    left: "50%",
                    transform: "translate(-50%, -50%)"
                }}
                className="container w-75 text-center">
                    
            </div>
        </section>
    );
};

export default AddImage;
